import React from "react"
import * as ReactDOMClient from "react-dom/client"

// ReactDOM.render(React.createElement('input', {
//   placeholder: "Help text",
//   onClick: () => console.log('click'),
//   onMouseEnter: () => console.log("Mouse Over")
// }), document.getElementById('exemple'))

const inputClick = () => console.log("Click");
const mouseOver = () => console.log("Mouse Over");

const helpText = "Help Text!"

const element = (<div className="block">
  <h1>{helpText}</h1>
  <input placeholder={helpText} onClick={inputClick} onMouseEnter={mouseOver} />
  <p>{helpText === "Help Text!" ? "Yes" : "No"}</p>
</div>)

const app = ReactDOMClient.createRoot(element, document.getElementById("exemple"))
app.render(element)
